import { __decorate } from "tslib";
import { Component } from '@angular/core';
let ProductoComponent = class ProductoComponent {
    constructor(api) {
        this.api = api;
        this.names = ["mary", "rossy"];
    }
    consultarProductos() {
        // this.api.consultarProductos().subscribe(res => { console.log(res) })
        this.api.consultarProductos().subscribe(res => {
            this.listaProductos = res.ObjetoGenerico;
        });
    }
    ngOnInit() {
        this.consultarProductos();
    }
};
ProductoComponent = __decorate([
    Component({
        selector: 'app-producto-component',
        templateUrl: './producto.component.html'
    })
], ProductoComponent);
export { ProductoComponent };
